Node* constructLinkedMatrix(int mat[MAX][MAX], int n)
{
    struct Node* head;
    struct Node* temp;
    
    vector<Node*> vec;
    for(int i = 0; i < n; i++){
        for(int j = 0; j < n; j++){
            Node* newNode = new Node(mat[i][j]);
            if(j == 0){
                temp = newNode;
                vec.push_back(temp);
            }
            else{
                temp->right = newNode;
                temp = newNode;
            }
        }
    }
    
    head = vec[0];
    for(int i = 0; i < n; i++){
        for(int j = 0; j < n-1; j++){
            vec[j]->down = vec[j+1];
            vec[j] = vec[j]->right;
        }
        vec[n-1] = vec[n-1]->right;
    }
    return head;
}

